import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useNavigate } from "react-router-dom";
import "../css/SignUpHospital.css";

export default function SignUpHospital() {
  const [name, setName] = useState("");
  const [address, setAddress] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [landline, setLandline] = useState("");
  const [p_number, setPNumber] = useState("");
  const [s_number, setSNumber] = useState("");
  const [doctors, setDoctors] = useState("");
  const [ambulances, setAmbulances] = useState("");

  const navigate = useNavigate();

  const onSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:3001/user/signupHosp", {
        name,
        address,
        email,
        password,
        landline,
        p_number,
        s_number,
        doctors,
        ambulances,
      });
      navigate("/Login");
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="SignUpHospital">
      <div className="main_box">
        <div className="form_box">
          <Link to="/">back</Link>
          <h3>Signup to Medinav</h3>
          <form className="row g-3" onSubmit={onSubmit}>
            <div className="mb-3 form_row">
              <label for="exampleInputEmail1" className="form-label">
                Hospital Name
              </label>
              <input
                type="text"
                className="form-control"
                id="exampleInputEmail1"
                placeholder="Enter your full name"
                value={name}
                onChange={(e) => {
                  setName(e.target.value);
                }}
              />
            </div>
            <div className="mb-3 form_row">
              <label for="exampleInputEmail1" className="form-label">
                Address
              </label>
              <input
                type="text"
                className="form-control"
                id="exampleInputEmail1"
                placeholder="Enter your address"
                value={address}
                onChange={(e) => {
                  setAddress(e.target.value);
                }}
              />
            </div>
            <div className="mb-3 form_row">
              <label for="exampleInputPassword1" className="form-label">
                Password
              </label>
              <input
                type="password"
                className="form-control"
                id="exampleInputPassword1"
                placeholder="Enter Your Password"
                value={password}
                onChange={(e) => {
                  setPassword(e.target.value);
                }}
              />
            </div>
            <div class="col-md-6">
              <label for="inputEmail4" class="form-label">
                Email
              </label>
              <input
                type="email"
                class="form-control"
                id="inputEmail4"
                value={email}
                onChange={(e) => {
                  setEmail(e.target.value);
                }}
              />
            </div>
            <div class="col-md-6">
              <label for="inputPassword4" class="form-label">
                Landline Number
              </label>
              <input
                type="number"
                class="form-control"
                id="inputPassword4"
                value={landline}
                onChange={(e) => {
                  setLandline(e.target.value);
                }}
              />
            </div>
            <div class="col-md-6">
              <label for="inputEmail4" class="form-label">
                Primary Mobile Number
              </label>
              <input
                type="number"
                class="form-control"
                id="inputEmail4"
                value={p_number}
                onChange={(e) => {
                  setPNumber(e.target.value);
                }}
              />
            </div>
            <div class="col-md-6">
              <label for="inputPassword4" class="form-label">
                Secondary Mobile Number
              </label>
              <input
                type="number"
                class="form-control"
                id="inputPassword4"
                value={s_number}
                onChange={(e) => {
                  setSNumber(e.target.value);
                }}
              />
            </div>
            <div class="col-md-6">
              <label for="inputEmail4" class="form-label">
                Number of On Call Doctors
              </label>
              <input
                type="number"
                class="form-control"
                id="inputEmail4"
                value={doctors}
                onChange={(e) => {
                  setDoctors(e.target.value);
                }}
              />
            </div>
            <div class="col-md-6">
              <label for="inputPassword4" class="form-label">
                Number of Operational Ambulances
              </label>
              <input
                type="number"
                class="form-control"
                id="inputPassword4"
                value={ambulances}
                onChange={(e) => {
                  setAmbulances(e.target.value);
                }}
              />
            </div>
            <div className="bring_child_to_center">
              <button type="submit" className="btn btn-primary button">
                Creat Account
              </button>
            </div>
          </form>

          <p className="bring_link_to_center">
            Already an account?<Link to="/LogIn">Log In</Link>
          </p>
          <p className="bring_link_to_center">
            <Link to="/SignUp/Reporter">Sign up as Reporter</Link>
          </p>
        </div>
      </div>
    </div>
  );
}
